import './App.css';
import React from 'react';

function App() {
  return (
    <div>
      <head>
        <script src="https://kit.fontawesome.com/d1b1f6e6ef.js" crossorigin="anonymous"></script>
      </head>
      <body className="App-header">
        <div class="dropdown">
          <i class="fa-solid fa-plus-large"></i>
        </div>
      </body>
    </div>
  );
}

export default App;
